<script>
import { ethers } from "ethers";
import WalletConnectProvider from "@walletconnect/web3-provider";
import Web3Modal from "web3modal";

export default {
  name: "Navbar",
  data() {
    return {
      user: null,
      loading: true,
      providerOptions: {
        injected: {
          display: {
            logo: "data:image/svg+xml;utf8;base64,",
            name: "MetaMask",
            description: "Connect with MetaMask",
          },
          package: null,
        },
        // Example with WalletConnect provider
        walletconnect: {
          display: {
            logo: "data:image/png;base64,",
            name: "Wallet Connect",
            description: "Scan qrcode with your mobile wallet and conenct",
          },
          package: WalletConnectProvider,
          options: {
            rpc: {
              137: "https://api.avax.network/ext/bc/C/rpc",
            },
          },
        },
      },

      web3Modal: null,
    };
  },
  mounted() {
    this.web3Modal = new Web3Modal({
      network: "mainnet", // optional
      cacheProvider: true, // optional
      providerOptions: this.providerOptions, // required
    });
    if (this.web3Modal.cachedProvider) {
      this.web3Modal.connect().then((instance) => {
        const provider = new ethers.providers.Web3Provider(instance);
        this.setUser(provider.getSigner());
      });
    }
    this.loading = false;
  },
  methods: {
    setUser(user) {
      this.user = user;
    },
    logout() {
      this.web3Modal.clearCachedProvider();
      this.user = null;
    },
    async connect() {
      const instance = await this.web3Modal.connect();
      const provider = new ethers.providers.Web3Provider(instance);
      this.setUser(provider.getSigner());
    },
  },
};
</script>
